int32_t index_die = -1;  //8
int32_t index_secret = -1; //9
	
int32_t index_intro = 0;	// 0
int32_t index_overworld = 0;	// 1
int32_t index_dungeon = 0;	 // 2
int8_t cur_music = 0;

void _soundTask(){
	switch (cur_sound) {
		case 0:
			if (index_kill < 2049){
				DAC_Out(Kill[index_kill]);
				index_kill++;
			} else cur_sound = -1;	// back to play music
			break;
		case 1:
			if (index_sword < 1671){
				DAC_Out(Sword[index_sword]);
				index_sword++;
			} else cur_sound = -1;	// back to play music
			break;
		case 2:
			if (index_hit < 2695){
				DAC_Out(Hit[index_hit]);
				index_hit++;
			} else cur_sound = -1;	// back to play music
			break;
		case 3:
			if (index_hurt < 754){
				DAC_Out(Hurt[index_hurt]);
				index_hurt++;
			} else cur_sound = -1;	// back to play music
			break;
		case 4:
			if (index_getheart < 1140){
				DAC_Out(GetHeart[index_getheart]);
				index_getheart++;
			} else cur_sound = -1;	// back to play music
			break;
		case 5:
			if (index_arrow < 868){
				DAC_Out(Arrow[index_arrow]);
				index_arrow++;
			} else cur_sound = -1;	// back to play music
			break;
			
		case 6:
			if (index_bombBlow < 4221){
				DAC_Out(BombBlow[index_bombBlow]);
				index_bombBlow++;
			} else cur_sound = -1;	// back to play music
			break;
			
		case 7:
			if (index_bossScream2 < 8367) {
				DAC_Out(BossScream2[index_bossScream2]);
				index_bossScream2++;
			} else cur_sound = -1;
			break;
			
		case 8:
			if (index_die < 27776) {
				DAC_Out(Die[index_die]);
				index_die++;
			} else cur_sound = -1;
			break;
			
		case 9:
			if (index_secret < 17827) {
				DAC_Out(Secret[index_secret]);
				index_secret++;
			} else cur_sound = -1;
			break;

		default:	// play music
			if (cur_music == 0){
				DAC_Out(Intro[index_intro]);
				index_intro = (index_intro + 1) % 30359 ;
			}
			if (cur_music == 1){
				DAC_Out(Overworld[index_overworld]);
				index_overworld = (index_overworld + 1) % 35632 ;
			}
			if (cur_music == 2){
				DAC_Out(Dungeon[index_dungeon]);
				index_dungeon = (index_dungeon + 1) % 30370 ;
			}
		
	}
}


void Sound_Init() {
	DAC_Init();
	Timer1_Init(_soundTask,80000000/11025);
}

void playKill() {
	cur_sound = 0;	// select Kill sound effect
	index_kill = 0; // init Kill sound effect
}

void playSword() {
	cur_sound = 1;
	index_sword = 0;
}

void playHit() {
	cur_sound = 2;
	index_hit = 0; 
}

void playHurt() {
	cur_sound = 3;
	index_hurt = 0;
}

void playGetHeart() {
	cur_sound = 4;
	index_getheart = 0;
}

void playArrow() {
	cur_sound = 5;
	index_arrow = 0;
}

void playBombBlow() {
	cur_sound = 6;
	index_bombBlow = 0;
}

void playBossScream2() {
	cur_sound = 7;
	index_bossScream2 = 0;
}

void playDie() {
	cur_sound = 8;
	index_die = 0;
}

void playSecret() {
	cur_sound = 9;
	index_secret = 0;
}

// pass a parameter 0,1 or 2 for different music
void playMusic(uint8_t music) {
	static int8_t previous = -1; // if current is not previous (music changed), restore the index
	cur_music = music;
	if (previous != music) {
		index_intro = 0;
		index_overworld = 0;
		index_dungeon = 0;
	}
	previous = music;
	
}
